import React from 'react';
import {withRouter } from 'react-router-dom';
import { connect } from 'react-redux';
import Header from '../Header/Header';
import axios from 'axios';
import './table.css';
import * as contactsAction from '../../actions/contactAction';

class MyContacts extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            isLoading: false,
        }
    }

    componentDidMount(){
        const loggingIn = localStorage.getItem('user-token');
        if(!loggingIn){
          this.props.history.push("/");
        }
        const {user_id} = 1;
        this.props.fetchContact();
     }

     deletUser = (id) => {
        if (window.confirm('Are you sure you want to delete this item?')) {
            this.props.deleteContact(id);
        }

     }


    render() {
        const {contactList} = this.props;
        const{isLoading}= this.state;

         return (
            <>
            <Header />
                <div className="container">
                    <div className="table-wrapper">
                    <div className="table-title">
                        <div className="row">
                        <div className="col-sm-5">
                            <h2>My <b>Contacts Listing</b></h2>
                        </div>
                        </div>
                    </div>
                    <table className="table table-striped table-hover">
                            <thead>
                            <tr>
                                <th>#</th>
                                <th>Name</th>						
                                <th>Contact No</th>
                                <th>Email</th>
                                <th>Date Created</th>
                                <th>Action</th>
                            </tr>
                            </thead>
                            <tbody>
                            {contactList.map((user,index) => {
                                return(
                                    <tr>
                                   <td>{index == 0 ? 1 : index}</td>
                                   <td><a href="#"><img src="#" className="avatar" />{user.name}</a></td>  
                                    <td>{user.contact_no}</td>                     
                                    <td>{user.email_id}</td> 
                                    <td>{user.createdAt}</td>
                                    <td>
                                    <a href="#" className="icon_margin"><i className="fa fa-edit" aria-hidden="true"></i></a>
                                    <a href="#" className="icon_margin"><i className="fa fa-eye" aria-hidden="true"></i></a>
                                    <a href="#" className="icon_margin"><i className="fa fa-trash" aria-hidden="true" onClick={()=> this.deletUser(user.id)}></i></a>
                                </td>
                                </tr>
                                );
                            })
                            }
                        </tbody>
                        </table>
                        <div className="clearfix">
                            <ul className="pagination">
                            <li className="page-item disabled"><a href="#">Previous</a></li>
                            <li className="page-item"><a href="#" className="page-link">1</a></li>
                            <li className="page-item"><a href="#" className="page-link">2</a></li>
                            <li className="page-item active"><a href="#" className="page-link">3</a></li>
                            <li className="page-item"><a href="#" className="page-link">4</a></li>
                            <li className="page-item"><a href="#" className="page-link">5</a></li>
                            <li className="page-item"><a href="#" className="page-link">Next</a></li>
                            </ul>
                        </div>
                        </div>
                </div>


            </>
        );
    }
}
const mapStateToProps = (state)=> {
    console.log('i am data',state);
    return {
        contactList:state.fechContactReducer.contacts,
        userinfo:state.loginReducer.currentUser,

    };
  }
export default withRouter(connect(mapStateToProps, { ...contactsAction})(MyContacts));
